.a-6-bg {
  background-color: #fff;
}
.page-content-chain {
  padding-top: 37px;
  padding-left: 47px;
  padding-right: 47px;
  box-sizing: border-box;
  background-color: #F7F7F7;
}
.content-box {
  display: flex;
  .left {
    width: 326px;
    margin-right: 16px;
  }
  .center {
    width: calc(100% - 677px);
  }
  .right {
    width: 319px;
    margin-left: 16px;
  }

  .input-box {
    width: 326px;
    height: 36px;
    border-radius: 18px;
    display: flex;
    align-items: center;
    padding-left: 16px;
    padding-right: 16px;
    box-sizing: border-box;
    background-color: #fff;
    margin-bottom: 30px;
    img {
      width: 24px;
      height: 24px;
      margin-right: 16px;
    }
  }

  .left-content {
    height: 1157px;
    border-radius: 10px;
    background-color: #fff;
    .coin-tabs {
      display: flex;
      margin-bottom: 19px;
      .coin-item {
        width: 50%;
        height: 45px;
        line-height: 45px;
        text-align: center;
        background-color: rgba(167, 180, 203, .1);
        font-size: 14px;
        font-weight: 700;
        color: #16161F;
        cursor: pointer;
        &:first-child {
          border-top-left-radius: 10px;
        }
        &:last-child {
          border-top-right-radius: 10px;
        }
        &.active {
          background-color: #fff;
          color: #1269FF;
          border-bottom: 1px solid rgba(167, 180, 203, .1);
        }
      }
    }
    .coin-container {
      height: calc(100% - 65px);
      background-color: #fff;
      border-radius: 10px;
    }
  }

  .center-top {
    height: 697px;
    background-color: #fff;
    border-radius: 10px;
    margin-bottom: 26px;
  }
}
.content-bottom {
  margin-top: 38px;
}
